import React from 'react';
import { Image } from 'antd';
import { Col, Button, Menu, Row } from 'antd';
import logo from './logo.svg';
import './App.css';

function App() {
  const onChange = (currentSlide: number) => {
    console.log(currentSlide);
  };

  return (
    <div className="App">
      <div className='OurPets'>
        <div className='Menu'>
          <Menu mode="horizontal">
            <Menu.Item key="home">
              <a href="/">Home</a>
            </Menu.Item>
            <Menu.Item key="about">
              <a href="/about">About</a>
            </Menu.Item>
            <Menu.Item key="contact">
              <a href="/contact">Contact</a>
            </Menu.Item>
          </Menu>
        </div>
        <Row gutter={{ xs: 8, sm: 16, md: 24, lg: 32 }}>
          <Col span={12}>
            <h1>No solo las personas necesitan una casa</h1>
            <p> Blacky es un perrito lindo, cariñoso y muy jugueton. Si buscas un compañero de paseo el es la mejor opción</p>
          </Col>
          <Col span={12}>
            <Image
              width={200}
              src="data:image/jpeg;base64,"
            />
          </Col>
        </Row>
      </div>
      <header className="App-header">

      <Image
        width={200}
        src="https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png"
      />
      </header>
    </div>
  );
}

export default App;
